          以往到日本朝聖全球最美書店「蔦屋書店 」，現在在家就能享受<br />
          台南首座與臺灣蔦屋TSUTAYA BOOKSTORE攜手打造<br />
          將現代和風生活提案帶入〔西門大院〕書香人文空間<br />
          包括四季大花園、和風書苑、健身房、兒童遊戲閱覽室<br />
          才藝教室、閱覽室、空中花園等豐富的樂齡共享休閒設施
        </p>
