        <p class="swiper-intro-text-3">
          座落豪宅林立鄭子寮高級住宅生活聚落，18座公園綠意環繞<br />
          市心難得低密度高綠覆開發，文元國小高升學率明星學區<br />
          禮聘台北名宅大師團隊打造，正西門路凌空24層雙塔地標<br />
          千坪開闊大基地，三面臨路好風光，高坪效精工制震宅<br />
          等待是值得的，鄭子寮最美的日系花園建築，2021即將美好盛開
        </p>
